ERROR - 2025-02-03 13:24:53 --> Query error: ERROR:  invalid byte sequence for encoding "UTF8": 0xd1 0x30 - Invalid query: INSERT INTO "sm_cppt" ("id_layanan_pendaftaran", "waktu", "id_profesi", "subject", "objective", "assessment", "plan", "ademi_assesment", "ademi_diag", "ademi_interv", "ademi_monev", "sbar_situation", "sbar_background", "sbar_assesment", "sbar_recommend", "id_nadis", "ttd_nadis", "instruksi_ppa", "id_dokter_dpjp", "id_user", "konsul_via_telp", "konsul", "created_date") VALUES ('684074', '2025-02-03 13:30', '18', 'tidak dapat di kaji', 'kesadaran CM , pasien pindahan dari nicu dengan RDS perbaikan, gerak aktif, retraksi -, tampak ikterik di badan, kramer 3,  reflek hisap + adekuat, asi tidak ada, suhu  36,6 nadi 128x/mnt rr 40x/mnt spo2 95% , terpasang infus D100c/jam Hasil CRP (01/2/25) 0,44, Berat Lahir: 3.280 gram, Berat badan saat ini 3.250gram, Lingkar Perut 30 cm', 'menyusui tidak efektif, resiko ikterik neonatus', 'Setelah dilakukan tindakan keperawatan selama 2x24 jam diharapkan status menyusui membaik dengan kriteria hasil: Perlekatan bayi pada payudara ibu meningkat, Kemampuan ibu memposisikan bayi dengan benar meningkat, Miksi bayi lebih dari 8x dalam 24 jam meningkat, Berat badan bayi meningkat, Intake bayi meningkat, Hisapan bayi meningkat, Bayi rewel menurun, Bayi menangis setelah menyusu menurun serta integritas dan jaringan kulit meningkat dengan kriteria hasil : Elastisitas meningkat, Hidrasi meningkat, Perfusi jaringan meningkat, Pigmentasi abnormal menurun.', '', '', '', '', '', '', '', '', '1686', '1', 'Intervensi Keperawatan: Identifikasi keinginan dan tujuan menyusui, Berikan informasi dan saran menyusui yang benar sesuai kebutuhan ibu, monitor tandavital bayi, Monitor kesadaran/status neurologis, kardiovaskuler, pernafasan, suhu, warna kulit, atau Spo2 dengan mengunakan formulir Newborn Earting Warning System &#40;NEWS&#41;, mandikan bayi dengan suhu ruangan 21-24, anjurkan ibu untuk memerah asi sesuai kebutuhan bayi.<div>Kolaborasi : Rencana cek SHK (tanggal 4/2/25 atau sebelum pulang)kertas saring belum, diet susu formula karena asi ibu belum ada, IC Susu Formula terlampir.</div>', NULL, '1686', 0, NULL, '2025-02-03 13:24:53')
